import React from 'react';
import '../css/App.css';
import logo from '../img/logo.svg';

import Home from "./Home";
import About from "./About";
import Work from "./Work";

import { BrowserRouter as Router, Route, Link } from "react-router-dom";

function App() {
  return (
    <Router>
      <Header />
      <main>
        <Route exact path="/" component={Home} />
        <Route path="/about" component={About} />
        <Route path="/work" component={Work} />
      </main>
    </Router>
  );
}

function Header() {
  return (
    <header className="content flex md:flex-row flex-col items-center md:justify-between mx-auto md:px-16 pt-16">
      <ul className="flex">
        <li className="mr-6">
          <Link className="hover:text-grey-800" to="/">Home</Link>
        </li>
        <li className="mr-6">
          <Link className="hover:text-grey-800" to="/about">About</Link>
        </li>
        <li className="mr-6">
          <Link className="hover:text-grey-800" to="/work">Work</Link>
        </li>
      </ul>
      <img src={logo} className="logo" alt="logo" />
    </header>
  );
}

export default App;
